import {Injectable} from '@angular/core';
import {IConfig} from "../../app.component";

@Injectable({
  providedIn: 'root'
})
export class ChatState {
  private _apiKey: string = '';

  private _config: any = {};

  get apiKey(): string {
    return this._apiKey;
  }

  get config(): IConfig {
    return this._config;
  }

  constructor() { }

  public setParams(apiKey: string, config: any) {
    this._apiKey = apiKey;
    this._config = config;
  }
}
